import React from 'react'
import SwapiService from '../../Services/swapi-service'

import './random-planet.css'
import { timeout } from 'q';

const RandomPlanet = async() => {

   const swip = new SwapiService();
   const name = await swip.getPlanet(5).then(async (el)=>{
        console.log(el.name);
        return el.name;
   });

   

   return(
       <div   className="random-planet list-group-item">
         <img className="planet-image"
             src = "https://starwars-visualguide.com/assets/img/planets/10.jpg" alt = 'pict show'/>
         <div className="flex-column"> 
               <h4 className = "test">Name Planet {name}</h4>
          <ul className = "list-group-flash">
             <li className=" list-group-item">
                    <span className= "term">Population</span>
                    <span>StarShip</span>
                </li>
                <li className="list-group-item">
                    <span className= "term">Rotation Period</span>
                    <span>StarShip</span>
                </li>
                <li className=" list-group-item">
                    <span className= "term">Diametr</span>
                    <span>StarShip</span>
                </li>
             </ul>
        </div>
            
       </div>
   );
};

export default RandomPlanet;
